function initMap(){var o={lat:60.128,lng:18.643};map=new google.maps.Map(document.getElementById("map"),{zoom:2,center:o})}function getMyLocation(o,e){navigator.geolocation.getCurrentPosition(function(t){var n={lat:t.coords.latitude,lng:t.coords.longitude};o.setCenter(n),o.setZoom(10),getCity(e,n)})}function getCity(o,e){var t="";o.geocode({location:e},function(o,e){if("OK"===e)for(var n=0;n<o.length;n++)for(var a=0;a<o[n].types.length;a++)"postal_town"===o[n].types[a]&&(t=o[n].address_components[0].short_name,loadStoreSearchData(t));else alert(e)})}function geocodeAddress(o,e,t,n){var t=t;o.geocode({address:t},function(o,a){if("OK"===a)for(var r=0;r<o.length;r++){e.setCenter(o[r].geometry.location),e.setZoom(12);var i=new google.maps.Marker({map:e,position:o[r].geometry.location,url:n,title:t});google.maps.event.addListener(i,"click",function(){window.location.href="store.html?id="+i.url})}else alert("Something went wrong when geocoding "+a)})}initMap();var geocoder=new google.maps.Geocoder,map;